import React from 'react'

// 로그인 상태에 따라 다른 페이지로 이동되도록 구현하시오.
// 로그인 상태 : 상품상세페이지로 이동
// 비로그인 상태 : 로그인페이지로 이동
const PrivateRoute = ({autenticate}) => {
  return autenticate ? <GoodsDetail/> : Nav
}

export default PrivateRoute
